import React  from "react";
import { Link } from "react-router-dom";

const Product = (props) => {
    const {id, thumbnailUrl, title} = props

    return (
        <div className="col s3">
        <img alt={id} src={thumbnailUrl}></img>
        <p><Link to={`${id}`}>{title}</Link></p>
    </div>
    )
}

export default Product;
